import React from "react";

export default function NavbarMobile() {
  return (
    <ul className="navbarMobile">
      <a className="btnMobile homeMobile" to="#">
        Home
      </a>
      <a className="btnMobile aboutMobile" to="/about">
        About
      </a>
      <a className="btnMobile projectsMobile" to="/projects">
        Projects
      </a>
      <a className="btnMobile contactMobile" to="/contact">
        Contact
      </a>
    </ul>
  );
}
